const postOrder = async (data = {}) => {
  const url = "http://localhost:8080/api/orders/order";
  const res = await fetch(url, {
    method: "POST",
    headers: {
      Accept: "application/json",
      "Content-Type": "application/json",
    },
    body: data,
  });
  const order = await res.json();
  return order;
};

export default postOrder;
